import React, { Fragment } from 'react';
import Tarea from './Tarea';

const ListadoTareas = () => {

    return (
        <Fragment>
            <h2>Panel de Control</h2>
            <ul className="Listado-tareas">
                <li className="tarea">Administrar</li>
                <li className="tarea">Organizacion</li>
                <li className="tarea">Plantel</li>
                <li className="tarea">Entrenamientos</li>
            </ul>
        </Fragment>
    );
}
export default ListadoTareas;
